import classes from "./Skills.module.css";
import Container from "react-bootstrap/esm/Container";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Skills = () => {
    return ( 

        <section className={classes.skills}>
            <Container>
                <h3 className={classes.skills__header}>Competencies</h3>
                <div className="skills__container">
                    <Row>
                        <Col>
                            <h6 className={classes.skills_subheader}>Certifications</h6>
                        </Col>
                        <Col>
                            <h6 className={classes.skills_subheader}>Skills</h6>
                            <p className={classes.skills_list}>Programming Languages: Python, Java, JavaScript, C, SQL</p>
                            <p className={classes.skills_list}>Libraries/Frameworks: React.js, Vue.js, Express.js, Material-UI, Bootstrap</p>
                            <p className={classes.skills_list}>Misc: AWS, Azure, CSS, HTML, PostgreSQL, Unix, Git, Jenkins</p>
                        </Col>
                    </Row>
                </div>
                </Container> 

        </section>
     );
}

export default Skills;
